import React from 'react';
import axios from 'axios';
import { Navbar, Nav, DropdownButton, Dropdown, Link } from 'react-bootstrap';
import { withRouter } from "react-router";

class MyNavBar extends React.Component {
  constructor(props) {
    super(props)
  }

  handleClick = () => {
    axios.delete('/api/logout', { withCredentials: true })
    .then(_ => {
      this.props.handleLogout()
      this.props.history.push('/')
    })
    .catch(error => console.log(error))
  }

  render() {
    const { checkedLogin, isLoggedIn, user } = this.props;
    if (!checkedLogin) {
      return null;
    }

    return (
      <Navbar bg="light" expand="lg">
        <Navbar.Brand href="/">MyFitnessApp</Navbar.Brand>
        <Navbar.Toggle />
        <Navbar.Collapse className="justify-content-end">
          {isLoggedIn && <DropdownButton title={user.email} variant="info">
            <Dropdown.Item tag={Link} to="/profile">Profile</Dropdown.Item>
            <Dropdown.Item onClick={this.handleClick}>Logout</Dropdown.Item>
          </DropdownButton>}
        </Navbar.Collapse>
      </Navbar>
    );
  }
}

export default withRouter(MyNavBar)
